// -- 绑定供应商
import React, { Component } from 'react';
import { Table, Form, Select, Button, Input, Icon } from 'antd'
const Option = Select.Option;
const { TextArea } = Input;
const FormItem = Form.Item;
class goodsTypeAdd extends Component {
    handleChange = (value) => {
        console.log(`selected ${value}`);
    }
    handleSubmit = (e) => {
        e.preventDefault();
        this.props.form.validateFields((err, values) => {
            if (err) return;
            console.log(values)
        });
    }
    render() {
        const { getFieldDecorator } = this.props.form;
        const formItemLayout = {
            labelCol: {
                xs: { span: 12 },
                sm: { span: 2 },
            },
            wrapperCol: {
                xs: { span: 12 },
                sm: { span: 22 },
            },
        };
        return (
            <Form onSubmit={this.handleSubmit} style={{ width: '100%' }}>
                <FormItem
                    {...formItemLayout}
                    label="父类型编号:"
                >
                    {getFieldDecorator('userName', {
                        rules: [],
                        initiaValue: '-1'
                    })(
                        <Select value="-1" style={{ width: '25%' }}>
                            <Option value="-1">请选择</Option>
                            <Option value="0">代销</Option>
                            <Option value="1">经营</Option>
                            <Option value="2">联营</Option>
                        </Select>
                    )}
                </FormItem>
                <FormItem
                    label="采购人员姓名:"
                    {...formItemLayout}
                >
                    {getFieldDecorator('password', {
                        rules: [],
                    })(
                        <Input type="password" />
                    )}
                </FormItem>
                <FormItem>
                    <Button type="primary" htmlType="submit" style={{ width: '100%' }}>
                        登录
                    </Button>
                </FormItem>
            </Form>
        )
    }
}
const goodsTypeAdds = Form.create()(goodsTypeAdd)
export default goodsTypeAdds
